  - name: TEXT4000
    number: '6'
    value: 'Please note the receipt of a campaign refund transaction included in this
      report from Crenshaw for Congress. This refund is for the incorrect deposit
      to that re-elect committee account of UTC PAC check#11140 issued 12/5/2013 to
